using namespace std;
#include <vector>

int main() {
    int numberOfCases;
    cin>>numberOfCases;
    vector<int> cases(numberOfCases);
    

    for(int i=0 ; i<numberOfCases ; i++) {
        cin>>cases[i];
    }
    int pIndex=0;
    for(int i=0 ; i<numberOfCases ; i++) {
        if(cases[i]>0) {
            pIndex=i;
            break;
        }
    }

    for(int i=pIndex+1 ; i<numberOfCases ; i++) {
       cases[i]+=cases[i-1];
    }

    int neg=0;
    for(int i=0 ; i<numberOfCases ; i++) {
        if(cases[i]<0) {
            neg++;
        }
    }
    cout<<neg;
}

